import React from 'react';
import { ThemeContext } from "../../context/Theme";
import { useContext, useState } from "react";

export const Transactions = ({setSelected}) => {
    const [theme] = useContext(ThemeContext);

return (
    <>
  <div className="container mx-auto p-4">
    <div className="flex items-center mb-4">
      <input
        type="text"
        placeholder="Search..."
        className="border border-gray-300 p-2 rounded-l-lg mr-2"
      />
      <select className="border border-gray-300 p-2 rounded-r-lg">
        <option>Option 1</option>
        <option>Option 2</option>
        <option>Option 3</option>
      </select>
    </div>
    <NotificationTable setSelected={setSelected} />
    <div className="flex justify-center">
      <button className="bg-blue-500 text-white px-4 py-2 rounded-lg">1</button>
      <button className="bg-blue-500 text-white px-4 py-2 rounded-lg mx-2">2</button>
      <button className="bg-blue-500 text-white px-4 py-2 rounded-lg">3</button>
    </div>
  </div>
  </>   
    );
};

export default Transactions;
